import mongoose from "mongoose";

const foodCategorySchema = new mongoose.Schema({
  title: {
    type: String,
    required: [true, "Please filled foodTitle"],
  },
  foodImage: {
    type: String,
  },
  createAt: {
    type: Date,
    default: Date.now(),
  },
});

export default mongoose.model("Food_Category", foodCategorySchema);
